import React from "react";
import Header from "../../components/common/Header";
import * as S from "./style";

function LoginPage() {
  return (
    <S.Wrap>
      <Header />

      <style.InputBlock>
        <div>
          <Input
            name={"email"}
            onChange={handleOnChange}
            title={"이메일"}
            value={loginForm.email}
          />
          <Input
            type={"password"}
            name={"password"}
            onChange={handleOnChange}
            title={"비밀번호"}
            value={loginForm.password}
          />
        </div>
        <style.LoginSetting>
          <span>
            <span>아이디 찾기</span>
            <span> | </span>
            <span>비밀번호 찾기</span>
          </span>
          <input
            type={"checkbox"}
            id={"rememberAccount"}
            onClick={RememberACT}
            style={{ display: "none" }}
          />
          <label for={"rememberAccount"}>
            {Account ? (
              <img
                src={process.env.PUBLIC_URL + "/images/Common/checkedIcon.svg"}
              />
            ) : (
              <img
                src={
                  process.env.PUBLIC_URL + "/images/Common/uncheckedIcon.svg"
                }
              />
            )}

            <span>자동 로그인</span>
          </label>
        </style.LoginSetting>
      </style.InputBlock>
      <style.ButtonBlock>
        <FullButton btnName={"로그인"} onClick={handleLogin} />
        <StrokeButton btnName={"회원가입"} onClick={() => navigate("/join")} />
      </style.ButtonBlock>
    </S.Wrap>
  );
}

export default LoginPage;
